import React from 'react';
import Form from './Form';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, NavItem, NavLink } from 'react-bootstrap';

const Home = () => {
  return (
    <div>
      <Nav card={true}>
        <NavItem>
          <NavLink href='#'>Add check</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href='#'>See results</NavLink>
        </NavItem>
      </Nav>
    </div>
  );
};

export default Home;
